import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import classes from "../styles/Resources.module.css";
import background from "../images/resources.jpg";

export default function Resources() {

  const myStyle = {
    backgroundImage: `url(${background})`,
    backgroundSize: 'cover',
    alt: 'Photo by FWStudio from Pexels',
  };

  return (
    <div>
      <Navbar />
      <div className={classes.resources} style={myStyle}>
        <div className={classes.header}>
          <h1 className={`${classes.shadowsIntoLightRegular} ${classes.title}`}>Resources</h1>
        </div>
        <div className={classes.subHeader}>
          <p className={classes.robotoRegular}>These resources are meant to offer knowledge, tools, access to community, or crisis help. These are trusted references that may offer support for your mental health and wellbeing. Please note that these resources are not to be considered direct treament and <span className={classes.underline}>are not a substitute for therapy</span>.</p>
        </div>
        <div className={classes.list}>
          <p className={classes.robotoRegular}>Some text here for testing</p>
        </div>
      </div>
      <Footer />
    </div>
  )
}
